import logo from './logo.svg';
import './App.css';

function Counter() {
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <p>
                    Weekend fain din React!!!!
                </p>
            </header>
        </div>
    );
}

export default Counter;
